import React from 'react';
import sibinImage from '../assets/sibin.jpg';

const About = () => {
  return (
    <section id="about" className="card">
      <h2>About Me</h2>
      <div className="about-content">
        <img src={sibinImage} alt="Sibin KS" className="about-photo" />
        <p>
          {/* I'm <strong>Sibin K S</strong>, a passionate and detail-oriented Full Stack Developer with hands-on experience building responsive web and mobile applications. I specialize in creating user-centric, performance-optimized digital solutions using modern technologies like HTML, CSS, JavaScript, Flutter, and backend frameworks.<br /><br /> */}
    
        </p>
      </div>
    </section>
  );
};

export default About;
